import React from 'react'
import TextField from '@mui/material/TextField';
import InputAdornment from '@mui/material/InputAdornment';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';
import { purple } from '@mui/material/colors';
import NavigateNextIcon from '@mui/icons-material/NavigateNext';

const ColorButton = styled(Button)(({ theme }) => ({
  color: theme.palette.getContrastText(purple[500]),
  backgroundColor:  theme.palette.ali.main,
  '&:hover': {
    backgroundColor: theme.palette.ali.main,
    scale:"0.99"
  },
}));

export default function Create() {
  return (
    <Box
    sx={{width:"340px",
      mr:{xs:"200px"},
    ml:{sm:"200px"}}}
    className="border"
    component="form"
    
    >
        <TextField
        fullWidth={true}
          label="Transaction Title"
          sx={{ mt:"1px", display:"block"}}
          InputProps={{
            startAdornment: <InputAdornment position="start">&#128073;</InputAdornment>,
          }}
          variant="filled"
        />
    <TextField
            fullWidth={true}
          label="Transaction Title"
          sx={{ mt:"22px", display:"block"}}
          InputProps={{
            startAdornment: <InputAdornment position="start">$</InputAdornment>,
          }}
          variant="filled"
        />

<ColorButton onClick={(params) => {
  fetch(url, {
    method: "POST", 
    headers: {
      "Content-Type": "application/json",
      // 'Content-Type': 'application/x-www-form-urlencoded',
    },
    redirect: "follow", // manual, *follow, error
    referrerPolicy: "no-referrer", // no-referrer, *no-referrer-when-downgrade, origin, origin-when-cross-origin, same-origin, strict-origin, strict-origin-when-cross-origin, unsafe-url
    body: JSON.stringify(data), // body data type must match "Content-Type" header
  });
}} sx={{mt:"22px"}} variant="contained">
  Submit <NavigateNextIcon/>
  </ColorButton>

    </Box>
  );
};
